##------------------------------------------------------------------------   
# Tested max on 2021-09-05 No skips in SPEEDTEST at SET_VELOCITY_LIMIT VELOCITY=700 ACCEL=10000 ACCEL_TO_DEVEL=10000
[printer]
kinematics: corexy
max_velocity: 350 #350 
#max_velocity: 700                     #test resonance 
max_accel: 4500  #4500    		              #Max 4000
#max_accel: 10000                     #test resonance
#max_accel_to_decel: 2250            #test resonance
max_z_velocity: 15 #20 #15 			      #Max 15 for 12V TMC Drivers, can increase for 24V
max_z_accel: 350
#square_corner_velocity: 10.0
square_corner_velocity: 8 #5.0


#####################################################################
# 	X/Y Stepper Settings
#####################################################################

[stepper_x]
##	Connected to MOTOR 0  (B Motor)
step_pin: PF13
dir_pin: !PF12
enable_pin: !PF14
rotation_distance: 40
microsteps: 16
full_steps_per_rotation:200  #set to 400 for 0.9 degree stepper
endstop_pin: ^!PG6  # PA1 for X-max
position_min: 3
position_endstop: 350
position_max: 350
homing_speed: 70   #Max 100
second_homing_speed: 25
homing_retract_dist: 7
homing_positive_dir: true

##	Make sure to update below for your relevant driver (2208 or 2209)
[tmc2209 stepper_x]
uart_pin: PC4
interpolate: true
run_current: 1.0
hold_current: 0.5 #0.9
sense_resistor: 0.110
#stealthchop_threshold: 250

[stepper_y]
##	Connected to MOTOR 1 (A Motor)
step_pin: PG0
dir_pin: !PG1
enable_pin: !PF15
rotation_distance: 40
microsteps: 16
full_steps_per_rotation:200  #set to 400 for 0.9 degree stepper
endstop_pin: ^!PG9
position_min: -3
position_endstop: 355
position_max: 355
homing_speed: 60  #Max 100
second_homing_speed: 25
homing_retract_dist: 7
homing_positive_dir: true

##	Make sure to update below for your relevant driver (2208 or 2209)
[tmc2209 stepper_y]
uart_pin: PD11
interpolate: true
run_current: 1.0
hold_current: 0.5 #0.9
sense_resistor: 0.110
#stealthchop_threshold: 250
 
#####################################################################
# 	Z Stepper Settings
#####################################################################

## Z MCU - MOTOR 2
## Z0 Stepper - Front Left
[stepper_z]
step_pin: PG4
dir_pin: !PC1
enable_pin:  !PA0
rotation_distance: 40
gear_ratio: 80:16
microsteps: 16
#endstop_pin: probe:z_virtual_endstop
endstop_pin: ^PG10  # motor 2 endstop
##  Z-position of nozzle (in mm) to z-endstop trigger point relative to print surface (Z0)
##  (+) value = endstop above Z0, (-) value = endstop below
##	Increasing position_endstop brings nozzle closer to the bed
##  After you run Z_ENDSTOP_CALIBRATE, position_endstop will be stored at the very end of your config
position_endstop: 0.190 #1.318
position_max: 340
position_min: -5
homing_speed: 8
second_homing_speed: 4.0
homing_retract_dist: 2.55

##	Make sure to update below for your relevant driver (2208 or 2209)
[tmc2209 stepper_z]
uart_pin: PC7
interpolate: true
run_current: 0.700
#hold_current: 0.600
sense_resistor: 0.110
#stealthchop_threshold: 1000
#-----------------------------------------

## MCU - MOTOR 3
##	Z1 Stepper - Rear Left
[stepper_z1]
step_pin: PF9
dir_pin: PF10
enable_pin: !PG2
rotation_distance: 40
gear_ratio: 80:16
microsteps: 16

##	Make sure to update below for your relevant driver (2208 or 2209)
[tmc2209 stepper_z1]
uart_pin: PF2
interpolate: true
run_current: 0.700
#hold_current: 0.600
sense_resistor: 0.110
#stealthchop_threshold: 1000
#-----------------------------------------

##	Z MCU - MOTOR 4
##	Z2 Stepper - Rear Right
[stepper_z2]
step_pin: PC13
dir_pin:  !PF0
enable_pin: !PF1
rotation_distance: 40
gear_ratio: 80:16
microsteps: 16

##	Make sure to update below for your relevant driver (2208 or 2209)
[tmc2209 stepper_z2]
uart_pin: PE4
interpolate: true
run_current: 0.700
#hold_current: 0.600
sense_resistor: 0.110
#stealthchop_threshold: 1000
#-------------------------------------------

##	Z MCU - MOTOR 5
##	Z3 Stepper - Front Right
[stepper_z3]
step_pin: PE2
dir_pin: PE3
enable_pin: !PD4
rotation_distance: 40
gear_ratio: 80:16
microsteps: 16

##	Make sure to update below for your relevant driver (2208 or 2209)
[tmc2209 stepper_z3]
uart_pin: PE1
interpolate: true
run_current: 0.700
#hold_current: 0.600
sense_resistor: 0.110
#stealthchop_threshold: 1000


#####################################################################
# 	Extruder
#####################################################################
##	Validate the following thermistor type to make sure it is correct
##sensor_type: NTC 100K beta 3950
##sensor_pin: PF4


#	MCU - MOTOR 6
[extruder]
step_pin: PF11
dir_pin: !PG3
enable_pin: !PG5
##	Update value below when you perform extruder calibration
##	If you ask for 100mm of filament, but in reality it is 98mm:
##	rotation_distance = <previous_rotation_distance> * <actual_extrude_distance> / 100
##  22.6789511 is a good starting point
rotation_distance: 21.5450035	#Bondtech 5mm Drive Gears
##	Update Gear Ratio depending on your Extruder Type
##	Use 50:17 for Afterburner/Clockwork (BMG Gear Ratio)
##	Use 80:20 for M4, M3.1
gear_ratio: 50:17				#BMG Gear Ratio
microsteps: 16
full_steps_per_rotation: 200	#200 for 1.8 degree, 400 for 0.9 degree
nozzle_diameter: 0.400
filament_diameter: 1.75
heater_pin: PA2
sensor_type: Generic 3950  ##NTC 100K beta 3950
sensor_pin: PF4
min_temp: 0
max_temp: 270
max_power: 1.0
min_extrude_temp: 170
#control = pid
#pid_kp = 26.213
#pid_ki = 1.304
#pid_kd = 131.721
##	Try to keep pressure_advance below 1.0
#pressure_advance: 0.042    #ABS
##pressure_advance: 0.05 #0.05
##	Default is 0.040, leave stock
##pressure_advance_smooth_time: 0.040 # 0.040

##	MCU MOTOR 6
##	Make sure to update below for your relevant driver (2208 or 2209)
[tmc2209 extruder]
uart_pin: PC6
interpolate: false
run_current: 0.5
hold_current: 0.4
sense_resistor: 0.110
#stealthchop_threshold: 250

[firmware_retraction]
retract_length: 1
retract_speed: 30
unretract_extra_length: 0
unretract_speed: 30

[verify_heater extruder]
max_error: 120
check_gain_time: 20
hysteresis: 5
heating_gain: 2

#####################################################################
# 	Bed Heater
#####################################################################

[heater_bed]
##	SSR Pin - Z board, Fan Pin
heater_pin: PA1
sensor_type: Generic 3950 ##NTC 100K beta 3950
sensor_pin: PF3
##	Adjust Max Power so your heater doesn't warp your bed
max_power: 0.65
min_temp: 0
max_temp: 120
pwm_cycle_time: 0.017
#control: pid
#pid_kp: 58.437
#pid_ki: 2.347
#pid_kd: 363.769

[verify_heater heater_bed]
max_error: 120
#   The maximum "cumulative temperature error" before raising an
#   error. Smaller values result in stricter checking and larger
#   values allow for more time before an error is reported.
#   Specifically, the temperature is inspected once a second and if it
#   is close to the target temperature then an internal "error
#   counter" is reset; otherwise, if the temperature is below the
#   target range then the counter is increased by the amount the
#   reported temperature differs from that range. Should the counter
#   exceed this "max_error" then an error is raised. The default is
#   120.
check_gain_time: 90
#   This controls heater verification during initial heating.  Smaller
#   values result in stricter checking and larger values allow for
#   more time before an error is reported. Specifically, during
#   initial heating, as long as the heater increases in temperature
#   within this time frame (specified in seconds) then the internal
#   "error counter" is reset. The default is 20 seconds for extruders
#   and 60 seconds for heater_bed.
hysteresis: 5
#   The maximum temperature difference (in Celsius) to a target
#   temperature that is considered in range of the target. This
#   controls the max_error range check. It is rare to customize this
#   value. The default is 5.
heating_gain: 2
#   The minimum temperature (in Celsius) that the heater must increase
#   by during the check_gain_time check. It is rare to customize this
#   value. The default is 2.

